import Layout from "../Layout";
import Foot from "../Foot";
import Nav from "../Nav";

import React, { Component } from "react";

function Text() {
  return (
    <div class="w-full lg:h-screen flex pt-64 lg:pt-0 justify-center pb-64 lg:pb-0">
      <div class="px-14 py-14 font-Plex w-full 2xl:container flex flex-col justify-center text-white">
        <h2 class="text-lime-400 font-extrabold text-8xl lg:text-2xl">
          WE ARE LOOKING FOR OUTGOING, PASSIONATE PEOPLE TO PROMOTE THE YFAC
        </h2>
        <br></br>
        <p class="font-Lora lg:text-base text-5xl leading-loose">
          The YFAC is an international competition, so we are looking for
          Ambassadors to promote the competition in different schools, cities,
          and countries. YFAC Ambassadors will receive awards to honor their
          contributions, and the Ambassador who gets the most number of people
          to register for the YFAC will win a S$100 cash prize.
        </p>
        <h3 class="text-lime-400 font-extrabold text-8xl lg:text-2xl">
          <br></br>AMBASSADOR AWARDS AND PRIZES
        </h3>
        <p class="font-Lora lg:text-base text-5xl leading-loose">
          <br></br>Platinum Award & S$100 Cash Prize: You have the most overall
          participants registered. You have shown proof of promoting the YFAC in
          your community. <br></br>Gold Award: You have at least 30 participants
          registered. You have shown proof of promoting the YFAC in your
          community. <br></br>Silver Award: You have at least 20 participants
          registered. You have shown proof of promoting the YFAC in your
          community. <br></br>Bronze Award: You have at least 10 participants
          registered. <br></br>
          <br></br>Note: We are counting the number of registered participants,
          not teams. That means if you have 4 people registering together under
          a team, we will count 4 people towards your name. However,
          participants that do not submit an entry to the YFAC, whether
          individually or under a team, will not count towards your Ambassador
          count.
        </p>
        <h3 class="text-lime-400 font-extrabold text-8xl lg:text-2xl">
          <br></br>AMBASSADOR REQUIREMENTS{" "}
        </h3>
        <p class="font-Lora lg:text-base text-5xl leading-loose">
          <br></br>Ambassadors have to be between 13 and 18 years old.
        </p>
      </div>
    </div>
  );
}

export default class Ambassador extends Component {
  constructor(props) {
    super(props);
    this.state = {
      currentPage: null,
      width: 0,
    };
    this.updateWindowDimensions = this.updateWindowDimensions.bind(this);
  }

  componentDidMount() {
    this.updateWindowDimensions();
    window.addEventListener("resize", this.updateWindowDimensions);
  }

  componentWillUnmount() {
    window.removeEventListener("resize", this.updateWindowDimensions);
  }

  updateWindowDimensions() {
    this.setState({ width: window.outerWidth });
  }

  render() {
    if (this.state.width <= 640) {
      return (
        <div class="flex flex-col">
          <Nav />
          <Text />
          <Foot />
        </div>
      );
    } else {
      return (
        <Layout>
          <Text />
        </Layout>
      );
    }
  }
}
